import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import "./Employee.css"

const Employee = () => {
    const [Employee, setEmployee] = useState([]);


    useEffect(()=>{
        const fetchData = async()=>{
            const response =await axios.get("http://localhost/api/getall");
            setEmployee(response.data)
        }
    fetchData();
},[])

    return(

        <div className="empTable">
            <Link to={"/add"}>
            <button className="addbtn">Add User</button>
            </Link>
            <table border={1} cellPadding={10} cellSpacing={0}>
                <thead>
                    <tr>
                        <th>Unique Id</th>
                        <th>image</th>
                        <th>Name</th>
                        <th>Email </th>
                        <th>Mobile</th>
                        <th>Designation</th>
                        <th>Gender</th>
                        <th>Course</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        Employee.map((user,index)=>{
                            return(<tr>
                        <td>001</td>
                        <td>NA</td>
                        <td>Avinash</td>
                        <td>avinash@gmail.com</td>
                        <td>9948436534</td>
                        <td>HR</td>
                        <td>Male</td>
                        <td>MCA</td>
                        <td className="actionbtn">
                            <Link to={"/edit"}>
                                <button className="e">Edit</button>
                            </Link>
                            <button className="d">Delete</button>
                        </td>
                    </tr>
)})
                    }
                    
                </tbody>
            </table>
        </div>
    )
}

export default Employee;
